import React, {useState, useEffect} from 'react';
import { BrowserRouter as Router, Switch, Route, Link, Redirect } from 'react-router-dom';
import {Typography, Button, AppBar, Toolbar} from '@material-ui/core';
import styling from './styling/Styling'
import './App.css';

import Login from './authentication/Login';
import Signup from './authentication/Signup';


const App = () => {
  const [user, setUser] = useState({})
  const [loggedIn, setLoggedIn] = useState(false)


  return (
    <div className={styling().root}>

      <Router>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6" className={styling().title} >
              Home
            </Typography>
            <Button><Link to= "/login">Log In</Link></Button>
            <Button><Link to= "/signup">Sign Up</Link></Button>
            <Button><Link to= "/logout">Log Out</Link></Button>
          </Toolbar>
        </AppBar>

        <Switch>
          <Route exact path='/'>
            <header className="App-header">
              Welcome to FlatTrackerPal
            </header>
          </Route>
          <Route exact path='/login'>
            {loggedIn ? <Redirect to="/" /> : <Login setUser={setUser} setLoggedIn={setLoggedIn}/>}
          </Route>
          <Route exact path='/signup'>
            {loggedIn ? <Redirect to="/" /> : <Signup setUser={setUser} setLoggedIn={setLoggedIn}/>}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
